import React from "react";
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";

import Seconds from "./Seconds";

import "./App.css";
import "./reset.css";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <div>
            <Link to="/Seconds">2번페이지</Link>
          </div>
          <Route path="/" element={<Seconds />}></Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
